package com.web.projectplanner.a04_vo;


public class TaskTodo {
		private Long taskid;
	    private String text;
	    private String task_start_date;
	    private String task_end_date;
	    private String task_status;
	    private Long projectid;
	    private Long todoid;
	    private String empno;
	    private String todo_text;
	    private String todo_start_date;
	    private String todo_end_date;
	    private String todo_status;
		public TaskTodo() {
			super();
			// TODO Auto-generated constructor stub
		}
		public TaskTodo(Long taskid, String text, String task_start_date, String task_end_date, String task_status,
				Long projectid, Long todoid, String empno, String todo_tasktext, String todo_start_date,
				String todo_end_date, String todo_status) {
			super();
			this.taskid = taskid;
			this.text = text;
			this.task_start_date = task_start_date;
			this.task_end_date = task_end_date;
			this.task_status = task_status;
			this.projectid = projectid;
			this.todoid = todoid;
			this.empno = empno;
			this.todo_text = todo_tasktext;
			this.todo_start_date = todo_start_date;
			this.todo_end_date = todo_end_date;
			this.todo_status = todo_status;
		}
		public Long getTaskid() {
			return taskid;
		}
		public void setTaskid(Long taskid) {
			this.taskid = taskid;
		}
		public String getText() {
			return text;
		}
		public void setText(String text) {
			this.text = text;
		}
		public String getTask_start_date() {
			return task_start_date;
		}
		public void setTask_start_date(String task_start_date) {
			this.task_start_date = task_start_date;
		}
		public String getTask_end_date() {
			return task_end_date;
		}
		public void setTask_end_date(String task_end_date) {
			this.task_end_date = task_end_date;
		}
		public String getTask_status() {
			return task_status;
		}
		public void setTask_status(String task_status) {
			this.task_status = task_status;
		}
		public Long getProjectid() {
			return projectid;
		}
		public void setProjectid(Long projectid) {
			this.projectid = projectid;
		}
		public Long getTodoid() {
			return todoid;
		}
		public void setTodoid(Long todoid) {
			this.todoid = todoid;
		}
		public String getEmpno() {
			return empno;
		}
		public void setEmpno(String empno) {
			this.empno = empno;
		}
		
		public String getTodo_text() {
			return todo_text;
		}
		public void setTodo_text(String todo_text) {
			this.todo_text = todo_text;
		}
		public String getTodo_start_date() {
			return todo_start_date;
		}
		public void setTodo_start_date(String todo_start_date) {
			this.todo_start_date = todo_start_date;
		}
		public String getTodo_end_date() {
			return todo_end_date;
		}
		public void setTodo_end_date(String todo_end_date) {
			this.todo_end_date = todo_end_date;
		}
		public String getTodo_status() {
			return todo_status;
		}
		public void setTodo_status(String todo_status) {
			this.todo_status = todo_status;
		}
		
}
